import { AppBar, Button, Drawer, Toolbar } from '@mui/material'
import React, { useState } from 'react'

const CustomRightDrawer = () => {
    const[openDrawer, setOpenDrawer] = useState(false)
    const rightDrawer =() =>{
        setOpenDrawer(true)
    }
    const rightDrawerClose = () =>{
        setOpenDrawer(false)
    }
  return (
    <div>
      <AppBar>
        <Toolbar>

        <Button variant='outlined' color='inherit' onClick={rightDrawer}>right</Button>
        <Button variant='outlined' color='inherit'>left</Button>
        <Button variant='outlined' color='inherit'>top</Button>
        <Button variant='outlined' color='inherit'>bottom</Button>
        </Toolbar>
        
        
      </AppBar>
      <Drawer variant='temporary' anchor='right' open={openDrawer} onClose={rightDrawerClose}> Hello Right Drawer</Drawer>
    </div>
  )
}

export default CustomRightDrawer
